/**
 * Parses the externs and main inputs.
 *
 * @return A synthetic root node whose two children are the externs root
 *     and the main root
 */
Node parseInputs() {
  boolean devMode = options.devMode != DevMode.OFF;

  // If old roots exist (we are parsing a second time), detach each of the
  // individual file parse trees.
  if (externsRoot != null) {
    externsRoot.detachChildren();
  }
  if (jsRoot != null) {
    jsRoot.detachChildren();
  }

  // Parse main js sources.
  jsRoot = IR.block();
  jsRoot.setIsSyntheticBlock(true);

  externsRoot = IR.block();
  externsRoot.setIsSyntheticBlock(true);

  externAndJsRoot = IR.block(externsRoot, jsRoot);
  externAndJsRoot.setIsSyntheticBlock(true);

  if (options.tracer.isOn()) {
    tracker = new PerformanceTracker(jsRoot, options.tracer);
    addChangeHandler(tracker.getCodeChangeHandler());
  }

  Tracer tracer = newTracer("parseInputs");

  try {
    // Parse externs sources.
    for (CompilerInput input : externs) {
      Node n = input.getAstRoot(this);
      if (hasErrors()) {
        return null;
      }
      externsRoot.addChildToBack(n);
    }

    // Modules inferred in ProcessCommonJS pass.
    if (options.transformAMDToCJSModules || options.processCommonJSModules) {
      processAMDAndCommonJSModules();
    }

    // Check if inputs need to be rebuilt from modules.
    boolean staleInputs = false;

    // Check if the sources need to be re-ordered.
    if (options.dependencyOptions.needsManagement() &&
        !options.skipAllPasses &&
        options.closurePass) {
      for (CompilerInput input : inputs) {
        // Forward-declare all the provided types, so that they
        // are not flagged even if they are dropped from the process.
        for (String provide : input.getProvides()) {
          getTypeRegistry().forwardDeclareType(provide);
        }
      }

      try {
        inputs =
            (moduleGraph == null ? new JSModuleGraph(modules) : moduleGraph)
            .manageDependencies(options.dependencyOptions, inputs);
        staleInputs = true;
      } catch (CircularDependencyException e) {
        report(JSError.make(
            JSModule.CIRCULAR_DEPENDENCY_ERROR, e.getMessage()));

        // If in IDE mode, we ignore the error and keep going.
        if (hasErrors()) {
          return null;
        }
      } catch (MissingProvideException e) {
        report(JSError.make(
            MISSING_ENTRY_ERROR, e.getMessage()));

        // If in IDE mode, we ignore the error and keep going.
        if (hasErrors()) {
          return null;
        }
      }
    }

    for (CompilerInput input : inputs) {
      Node n = input.getAstRoot(this);

      // Inputs can have a null AST during initial parse.
      if (n == null) {
        continue;
      }

      if (n.getJSDocInfo() != null) {
        JSDocInfo info = n.getJSDocInfo();
        if (info.isExterns()) {
          // If the input file is explicitly marked as an externs file, then
          // assume the programmer made a mistake and throw it into
          // the externs pile anyways.
          externsRoot.addChildToBack(n);
          input.setIsExtern(true);

          input.getModule().remove(input);

          externs.add(input);
          staleInputs = true;
        } else if (info.isNoCompile()) {
          input.getModule().remove(input);
          staleInputs = true;
        }
      }
    }

    if (staleInputs) {
      fillEmptyModules(modules);
      rebuildInputsFromModules();
    }

    // Build the AST.
    for (CompilerInput input : inputs) {
      Node n = input.getAstRoot(this);
      if (n == null) {
        continue;
      }

      if (devMode) {
        runSanityCheck();
        if (hasErrors()) {
          return null;
        }
      }

      if (options.sourceMapOutputPath != null ||
          options.nameReferenceReportPath != null) {

        // Annotate the nodes in the tree with information from the
        // input file. This information is used to construct the SourceMap.
        SourceInformationAnnotator sia =
            new SourceInformationAnnotator(
                input.getName(), options.devMode != DevMode.OFF);
        NodeTraversal.traverse(this, n, sia);
      }

      jsRoot.addChildToBack(n);
    }

    if (hasErrors()) {
      return null;
    }
    return externAndJsRoot;
  } finally {
    stopTracer(tracer, "parseInputs");
  }
}

public Node getAstRoot(AbstractCompiler compiler) {
  Node root = ast.getAstRoot(compiler);
  // The root maybe null if the AST can not be created.
  if (root != null) {
    Preconditions.checkState(root.isScript());
    Preconditions.checkNotNull(root.getInputId());
  }
  return root;
}

public Node getAstRoot(AbstractCompiler compiler) {
  if (root == null) {
    parse(compiler);
    root.setInputId(inputId);
  }
  return root;
}

private void parse(AbstractCompiler compiler) {
  try {
    logger_.fine("Parsing: " + sourceFile.getName());
    root = ParserRunner.parse(sourceFile, sourceFile.getCode(),
        compiler.getParserConfig(),
        compiler.getDefaultErrorReporter(),
        logger_);
  } catch (IOException e) {
    compiler.report(
        JSError.make(AbstractCompiler.READ_ERROR, sourceFile.getName()));
  }

  if (root == null || compiler.hasHaltingErrors()) {
    // There was a parse error or IOException, so use a dummy block.
    root = IR.script();
  } else {
    compiler.prepareAst(root);
  }

  // Set the source name so that the compiler passes can track
  // the source file and module.
  root.setStaticSourceFile(sourceFile);
}

/**
 * Parses the JavaScript text given by a reader.
 *
 * @param sourceString Source code from the file.
 * @param errorReporter An error.
 * @param logger A logger.
 * @return The AST of the given text.
 * @throws IOException
 */
public static Node parse(StaticSourceFile sourceFile,
                         String sourceString,
                         Config config,
                         ErrorReporter errorReporter,
                         Logger logger) throws IOException {
  Context cx = Context.enter();
  cx.setErrorReporter(errorReporter);
  cx.setLanguageVersion(Context.VERSION_1_5);
  CompilerEnvirons compilerEnv = new CompilerEnvirons();
  compilerEnv.initFromContext(cx);
  compilerEnv.setRecordingComments(true);
  compilerEnv.setRecordingLocalJsDocComments(true);

  // ES5 specifically allows trailing commas
  compilerEnv.setWarnTrailingComma(
      config.languageMode == LanguageMode.ECMASCRIPT3);

  // Do our own identifier check for ECMASCRIPT 5
  boolean acceptEs5 =
      config.isIdeMode || config.languageMode != LanguageMode.ECMASCRIPT3;
  compilerEnv.setReservedKeywordAsIdentifier(acceptEs5);
  compilerEnv.setAllowKeywordAsObjectPropertyName(acceptEs5);

  compilerEnv.setAllowMemberExprAsFunctionName(false);
  compilerEnv.setIdeMode(config.isIdeMode);
  compilerEnv.setRecoverFromErrors(config.isIdeMode);

  Parser p = new Parser(compilerEnv, errorReporter);
  AstRoot astRoot = null;
  try {
    astRoot = p.parse(sourceString, sourceFile.getName(), 1);
  } catch (EvaluatorException e) {
    logger.info(
        "Error parsing " + sourceFile.getName() + ": " + e.getMessage());
  } finally {
    Context.exit();
  }
  Node root = null;
  if (astRoot != null) {
    root = IRFactory.transformTree(
        astRoot, sourceFile, sourceString, config, errorReporter);
    root.setIsSyntheticBlock(true);
  }
  return root;
}

public static Node transformTree(AstRoot node,
                                 StaticSourceFile sourceFile,
                                 String sourceString,
                                 Config config,
                                 ErrorReporter errorReporter) {
  IRFactory irFactory = new IRFactory(sourceString, sourceFile,
      config, errorReporter);
  Node irNode = irFactory.transform(node);

  if (node.getComments() != null) {
    for (Comment comment : node.getComments()) {
      if (comment.getCommentType() == CommentType.JSDOC &&
          !irFactory.parsedComments.contains(comment)) {
        irFactory.handlePossibleFileOverviewJsDoc(comment, irNode);
      } else if (comment.getCommentType() == CommentType.BLOCK_COMMENT) {
        irFactory.handleBlockComment(comment);
      }
    }
  }

  irFactory.setFileOverviewJsDoc(irNode);

  return irNode;
}

public Node transform(AstNode node) {
    switch (node.getType()) {
      case Token.ARRAYCOMP:
          return transformArrayComp((ArrayComprehension)node);
      case Token.ARRAYLIT:
          return transformArrayLiteral((ArrayLiteral)node);
      case Token.BLOCK:
          return transformBlock(node);
      case Token.BREAK:
          return transformBreak((BreakStatement)node);
      case Token.CALL:
          return transformFunctionCall((FunctionCall)node);
      case Token.CONTINUE:
          return transformContinue((ContinueStatement)node);
      case Token.DO:
          return transformDoLoop((DoLoop)node);
      case Token.EMPTY:
          return node;
      case Token.FOR:
          if (node instanceof ForInLoop) {
              return transformForInLoop((ForInLoop)node);
          } else {
              return transformForLoop((ForLoop)node);
          }
      case Token.FUNCTION:
          return transformFunction((FunctionNode)node);
      case Token.GENEXPR:
          return transformGenExpr((GeneratorExpression)node);
      case Token.GETELEM:
          return transformElementGet((ElementGet)node);
      case Token.GETPROP:
          return transformPropertyGet((PropertyGet)node);
      case Token.HOOK:
          return transformCondExpr((ConditionalExpression)node);
      case Token.IF:
          return transformIf((IfStatement)node);

      case Token.TRUE:
      case Token.FALSE:
      case Token.THIS:
      case Token.NULL:
      case Token.DEBUGGER:
          return transformLiteral(node);

      case Token.NAME:
          return transformName((Name)node);
      case Token.NUMBER:
          return transformNumber((NumberLiteral)node);
      case Token.NEW:
          return transformNewExpr((NewExpression)node);
      case Token.OBJECTLIT:
          return transformObjectLiteral((ObjectLiteral)node);
      case Token.REGEXP:
          return transformRegExp((RegExpLiteral)node);
      case Token.RETURN:
          return transformReturn((ReturnStatement)node);
      case Token.SCRIPT:
          return transformScript((ScriptNode)node);
      case Token.STRING:
          return transformString((StringLiteral)node);
      case Token.SWITCH:
          return transformSwitch((SwitchStatement)node);
      case Token.THROW:
          return transformThrow((ThrowStatement)node);
      case Token.TRY:
          return transformTry((TryStatement)node);
      case Token.WHILE:
          return transformWhileLoop((WhileLoop)node);
      case Token.WITH:
          return transformWith((WithStatement)node);
      case Token.YIELD:
          return transformYield((Yield)node);
      default:
          if (node instanceof ExpressionStatement) {
              return transformExprStmt((ExpressionStatement)node);
          }
          if (node instanceof Assignment) {
              return transformAssignment((Assignment)node);
          }
          if (node instanceof UnaryExpression) {
              return transformUnary((UnaryExpression)node);
          }
          if (node instanceof XmlMemberGet) {
              return transformXmlMemberGet((XmlMemberGet)node);
          }
          if (node instanceof InfixExpression) {
              return transformInfix((InfixExpression)node);
          }
          if (node instanceof VariableDeclaration) {
              return transformVariables((VariableDeclaration)node);
          }
          if (node instanceof ParenthesizedExpression) {
              return transformParenExpr((ParenthesizedExpression)node);
          }
          if (node instanceof LabeledStatement) {
              return transformLabeledStatement((LabeledStatement)node);
          }
          if (node instanceof LetNode) {
              return transformLetNode((LetNode)node);
          }
          if (node instanceof XmlRef) {
              return transformXmlRef((XmlRef)node);
          }
          if (node instanceof XmlLiteral) {
              return transformXmlLiteral((XmlLiteral)node);
          }
          throw new IllegalArgumentException("Can't transform: " + node);
    }
}

private Node transformArrayComp(ArrayComprehension node) {
    // An array comprehension expression such as
    //
    //   [expr for (x in foo) for each ([y, z] in bar) if (cond)]
    //
    // is rewritten approximately as
    //
    // new Scope(ARRAYCOMP) {
    //   new Node(BLOCK) {
    //     let tmp1 = new Array;
    //     for (let x in foo) {
    //       for each (let tmp2 in bar) {
    //         if (cond) {
    //           tmp1.push([y, z] = tmp2, expr);
    //         }
    //       }
    //     }
    //   }
    //   createName(tmp1)
    // }

    int lineno = node.getLineno();
    Scope scopeNode = createScopeNode(Token.ARRAYCOMP, lineno);
    String arrayName = currentScriptOrFn.getNextTempName();
    pushScope(scopeNode);
    try {
        defineSymbol(Token.LET, arrayName, false);
        Node block = new Node(Token.BLOCK, lineno);
        Node newArray = createCallOrNew(Token.NEW, createName("Array"));
        Node init = new Node(Token.EXPR_VOID,
                             createAssignment(Token.ASSIGN,
                                              createName(arrayName),
                                              newArray),
                             lineno);
        block.addChildToBack(init);
        block.addChildToBack(arrayCompTransformHelper(node, arrayName));
        scopeNode.addChildToBack(block);
        scopeNode.addChildToBack(createName(arrayName));
        return scopeNode;
    } finally {
        popScope();
    }
}

private void handlePossibleFileOverviewJsDoc(Comment comment, Node irNode) {
  JsDocInfoParser jsDocParser = createJsDocInfoParser(comment, irNode);
  parsedComments.add(comment);
  handlePossibleFileOverviewJsDoc(jsDocParser);
}

private Node arrayCompTransformHelper(ArrayComprehension node,
                                      String arrayName) {
    decompiler.addToken(Token.LB);
    int lineno = node.getLineno();
    Node expr = transform(node.getResult());

    List<ArrayComprehensionLoop> loops = node.getLoops();
    int numLoops = loops.size();

    // Walk through loops, collecting and defining their iterator symbols.
    Node[] iterators = new Node[numLoops];
    Node[] iteratedObjs = new Node[numLoops];

    for (int i = 0; i < numLoops; i++) {
        ArrayComprehensionLoop acl = loops.get(i);
        decompiler.addName(" ");
        decompiler.addToken(Token.FOR);
        if (acl.isForEach()) {
            decompiler.addName("each ");
        }
        decompiler.addToken(Token.LP);

        AstNode iter = acl.getIterator();
        String name = null;
        if (iter.getType() == Token.NAME) {
            name = iter.getString();
            decompiler.addName(name);
        } else {
            // destructuring assignment
            decompile(iter);
            name = currentScriptOrFn.getNextTempName();
            defineSymbol(Token.LP, name, false);
            expr = createBinary(Token.COMMA,
                                createAssignment(Token.ASSIGN,
                                                 iter,
                                                 createName(name)),
                                expr);
        }
        Node init = createName(name);
        // Define as a let since we want the scope of the variable to
        // be restricted to the array comprehension
        defineSymbol(Token.LET, name, false);
        iterators[i] = init;

        decompiler.addToken(Token.IN);
        iteratedObjs[i] = transform(acl.getIteratedObject());
        decompiler.addToken(Token.RP);
    }

    // generate code for tmpArray.push(body)
    Node call = createCallOrNew(Token.CALL,
                                createPropertyGet(createName(arrayName),
                                                  null,
                                                  "push", 0));

    Node body = new Node(Token.EXPR_VOID, call, lineno);

    if (node.getFilter() != null) {
        decompiler.addName(" ");
        decompiler.addToken(Token.IF);
        decompiler.addToken(Token.LP);
        body = createIf(transform(node.getFilter()), body, null, lineno);
        decompiler.addToken(Token.RP);
    }

    // Now walk loops in reverse to build up the body statement.
    int pushed = 0;
    try {
        for (int i = numLoops-1; i >= 0; i--) {
            ArrayComprehensionLoop acl = loops.get(i);
            Scope loop = createLoopNode(null,  // no label
                                        acl.getLineno());
            pushScope(loop);
            pushed++;
            body = createForIn(Token.LET,
                               loop,
                               iterators[i],
                               iteratedObjs[i],
                               body,
                               acl.isForEach());
        }
    } finally {
        for (int i = 0; i < pushed; i++) {
            popScope();
        }
    }

    decompiler.addToken(Token.RB);

    // Now that we've accumulated any destructuring forms,
    // add expr to the call node; it's pushed on each iteration.
    call.addChildToBack(expr);
    return body;
}

/**
 * Creates a JsDocInfoParser and parses the JsDoc string.
 *
 * Used both for handling individual JSDoc comments and for handling
 * file-level JSDoc comments (@fileoverview and @license).
 *
 * @param node The JsDoc Comment node to parse.
 * @param irNode
 * @return A JSDocInfoParser. Will contain either fileoverview jsdoc, or
 *     normal jsdoc, or no jsdoc (if the method parses to the wrong level).
 */
private JsDocInfoParser createJsDocInfoParser(Comment node, Node irNode) {
  String comment = node.getValue();
  int lineno = node.getLineno();
  int position = node.getAbsolutePosition();

  // The JsDocInfoParser expects the comment without the initial '/**'.
  int numOpeningChars = 3;
  JsDocInfoParser jsdocParser =
    new JsDocInfoParser(
        new JsDocTokenStream(comment.substring(numOpeningChars),
                             lineno,
                             position2charno(position) + numOpeningChars),
        node,
        irNode,
        config,
        errorReporter);
  jsdocParser.setFileLevelJsDocBuilder(fileLevelJsDocBuilder);
  jsdocParser.setFileOverviewJSDocInfo(fileOverviewInfo);
  jsdocParser.parse();
  return jsdocParser;
}

/**
 * Parses a {@link JSDocInfo} object. This parsing method reads all tokens
 * returned by the {@link JsDocTokenStream#getJsDocToken()} method until the
 * {@link JsDocToken#EOC} is returned.
 *
 * @return {@code true} if JSDoc information was correctly parsed,
 *     {@code false} otherwise
 */
boolean parse() {
  int lineno;
  int charno;

  // JSTypes are represented as Rhino AST nodes, and then resolved later.
  JSTypeExpression type;

  state = State.SEARCHING_ANNOTATION;
  skipEOLs();

  JsDocToken token = next();

  List<ExtendedTypeInfo> extendedTypes = Lists.newArrayList();

  // Always record that we have a comment.
  if (jsdocBuilder.shouldParseDocumentation()) {
    ExtractionInfo blockInfo = extractBlockComment(token);
    token = blockInfo.token;
    if (!blockInfo.string.isEmpty()) {
      jsdocBuilder.recordBlockDescription(blockInfo.string);
    }
  } else {
    if (token != JsDocToken.ANNOTATION &&
        token != JsDocToken.EOC) {
      // Mark that there was a description, but don't bother marking
      // what it was.
      jsdocBuilder.recordBlockDescription("");
    }
  }

  // Parse the actual JsDoc.
  retry: for (;;) {
    switch (token) {
      case ANNOTATION:
        if (state == State.SEARCHING_ANNOTATION) {
          state = State.SEARCHING_NEWLINE;
          lineno = stream.getLineno();
          charno = stream.getCharno();

          String annotationName = stream.getString();
          Annotation annotation = annotationNames.get(annotationName);
          if (annotation == null) {
            parser.addParserWarning("msg.bad.jsdoc.tag", annotationName,
                stream.getLineno(), stream.getCharno());
          } else {
            // Mark the beginning of the annotation.
            jsdocBuilder.markAnnotation(annotationName, lineno, charno);

            switch (annotation) {
              case AUTHOR:
                if (jsdocBuilder.shouldParseDocumentation()) {
                  ExtractionInfo authorInfo = extractSingleLineBlock();
                  String author = authorInfo.string;

                  if (author.length() == 0) {
                    parser.addParserWarning("msg.jsdoc.authormissing",
                        stream.getLineno(), stream.getCharno());
                  } else {
                    jsdocBuilder.addAuthor(author);
                  }
                  token = authorInfo.token;
                } else {
                  token = eatTokensUntilEOL(token);
                }
                continue retry;

              case CONSISTENTIDGENERATOR:
                if (!jsdocBuilder.recordConsistentIdGenerator()) {
                  parser.addParserWarning("msg.jsdoc.consistidgen",
                    stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case CONSTANT:
                if (!jsdocBuilder.recordConstancy()) {
                  parser.addParserWarning("msg.jsdoc.const",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case CONSTRUCTOR:
                if (!jsdocBuilder.recordConstructor()) {
                  if (jsdocBuilder.isInterfaceRecorded()) {
                    parser.addTypeWarning("msg.jsdoc.interface.constructor",
                        stream.getLineno(), stream.getCharno());
                  } else {
                    parser.addTypeWarning("msg.jsdoc.incompat.type",
                        stream.getLineno(), stream.getCharno());
                  }
                }
                token = eatTokensUntilEOL();
                continue retry;

              case DEPRECATED:
                if (!jsdocBuilder.recordDeprecated()) {
                  parser.addParserWarning("msg.jsdoc.deprecated",
                      stream.getLineno(), stream.getCharno());
                }

                // Find the reason/description, if any.
                ExtractionInfo reasonInfo =
                    extractMultilineTextualBlock(token);

                String reason = reasonInfo.string;

                if (reason.length() > 0) {
                  jsdocBuilder.recordDeprecationReason(reason);
                }

                token = reasonInfo.token;
                continue retry;

              case INTERFACE:
                if (!jsdocBuilder.recordInterface()) {
                  if (jsdocBuilder.isConstructorRecorded()) {
                    parser.addTypeWarning("msg.jsdoc.interface.constructor",
                        stream.getLineno(), stream.getCharno());
                  } else {
                    parser.addTypeWarning("msg.jsdoc.incompat.type",
                        stream.getLineno(), stream.getCharno());
                  }
                }
                token = eatTokensUntilEOL();
                continue retry;

              case DESC:
                if (jsdocBuilder.isDescriptionRecorded()) {
                  parser.addParserWarning("msg.jsdoc.desc.extra",
                      stream.getLineno(), stream.getCharno());
                  token = eatTokensUntilEOL();
                  continue retry;
                } else {
                  ExtractionInfo descriptionInfo =
                      extractMultilineTextualBlock(token);

                  String description = descriptionInfo.string;

                  jsdocBuilder.recordDescription(description);
                  token = descriptionInfo.token;
                  continue retry;
                }

              case FILE_OVERVIEW:
                String fileOverview = "";
                if (jsdocBuilder.shouldParseDocumentation()) {
                  ExtractionInfo fileOverviewInfo =
                      extractMultilineTextualBlock(token,
                          WhitespaceOption.TRIM);

                  fileOverview = fileOverviewInfo.string;

                  token = fileOverviewInfo.token;
                } else {
                  token = eatTokensUntilEOL(token);
                }

                if (!jsdocBuilder.recordFileOverview(fileOverview) ||
                    fileOverviewJSDocInfo != null) {
                  parser.addParserWarning("msg.jsdoc.fileoverview.extra",
                      stream.getLineno(), stream.getCharno());
                }
                continue retry;

              case LICENSE:
              case PRESERVE:
                ExtractionInfo preserveInfo =
                    extractMultilineTextualBlock(token,
                                                 WhitespaceOption.PRESERVE);

                String preserve = preserveInfo.string;

                if (preserve.length() > 0) {
                  if (fileLevelJsDocBuilder != null) {
                    fileLevelJsDocBuilder.append(preserve);
                  }
                }

                token = preserveInfo.token;
                continue retry;

              case ENUM:
                token = next();
                lineno = stream.getLineno();
                charno = stream.getCharno();

                type = null;
                if (token != JsDocToken.EOL && token != JsDocToken.EOC) {
                  type = createJSTypeExpression(
                      parseAndRecordTypeNode(token));
                }

                if (type == null) {
                  type = createJSTypeExpression(newStringNode("number"));
                }
                if (!jsdocBuilder.recordEnumParameterType(type)) {
                  parser.addTypeWarning(
                      "msg.jsdoc.incompat.type", lineno, charno);
                }
                token = eatTokensUntilEOL(token);
                continue retry;

              case EXPORT:
                if (!jsdocBuilder.recordExport()) {
                  parser.addParserWarning("msg.jsdoc.export",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case EXPOSE:
                if (!jsdocBuilder.recordExpose()) {
                  parser.addParserWarning("msg.jsdoc.expose",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case EXTERNS:
                if (!jsdocBuilder.recordExterns()) {
                  parser.addParserWarning("msg.jsdoc.externs",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case JAVA_DISPATCH:
                if (!jsdocBuilder.recordJavaDispatch()) {
                  parser.addParserWarning("msg.jsdoc.javadispatch",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case EXTENDS:
              case IMPLEMENTS:
                skipEOLs();
                token = next();
                lineno = stream.getLineno();
                charno = stream.getCharno();
                boolean matchingRc = false;

                if (token == JsDocToken.LC) {
                  token = next();
                  matchingRc = true;
                }

                if (token == JsDocToken.STRING) {
                  Node typeNode = parseAndRecordTypeNameNode(
                      token, lineno, charno, matchingRc);

                  lineno = stream.getLineno();
                  charno = stream.getCharno();

                  typeNode = wrapNode(Token.BANG, typeNode);
                  if (typeNode != null && !matchingRc) {
                    typeNode.putBooleanProp(Node.BRACELESS_TYPE, true);
                  }
                  type = createJSTypeExpression(typeNode);

                  if (annotation == Annotation.EXTENDS) {
                    // record the extended type, check later
                    extendedTypes.add(new ExtendedTypeInfo(
                        type, stream.getLineno(), stream.getCharno()));
                  } else {
                    Preconditions.checkState(
                        annotation == Annotation.IMPLEMENTS);
                    if (!jsdocBuilder.recordImplementedInterface(type)) {
                      parser.addTypeWarning("msg.jsdoc.implements.duplicate",
                          lineno, charno);
                    }
                  }
                  token = next();
                  if (matchingRc) {
                    if (token != JsDocToken.RC) {
                      parser.addTypeWarning("msg.jsdoc.missing.rc",
                          stream.getLineno(), stream.getCharno());
                    }
                  } else if (token != JsDocToken.EOL &&
                      token != JsDocToken.EOF && token != JsDocToken.EOC) {
                    parser.addTypeWarning("msg.end.annotation.expected",
                        stream.getLineno(), stream.getCharno());
                  }
                } else {
                  parser.addTypeWarning("msg.no.type.name", lineno, charno);
                }
                token = eatTokensUntilEOL(token);
                continue retry;

              case HIDDEN:
                if (!jsdocBuilder.recordHiddenness()) {
                  parser.addParserWarning("msg.jsdoc.hidden",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case LENDS:
                skipEOLs();

                matchingRc = false;
                if (match(JsDocToken.LC)) {
                  token = next();
                  matchingRc = true;
                }

                if (match(JsDocToken.STRING)) {
                  token = next();
                  if (!jsdocBuilder.recordLends(stream.getString())) {
                    parser.addTypeWarning("msg.jsdoc.lends.incompatible",
                        stream.getLineno(), stream.getCharno());
                  }
                } else {
                  parser.addTypeWarning("msg.jsdoc.lends.missing",
                      stream.getLineno(), stream.getCharno());
                }

                if (matchingRc && !match(JsDocToken.RC)) {
                  parser.addTypeWarning("msg.jsdoc.missing.rc",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case MEANING:
                ExtractionInfo meaningInfo =
                    extractMultilineTextualBlock(token);
                String meaning = meaningInfo.string;
                token = meaningInfo.token;
                if (!jsdocBuilder.recordMeaning(meaning)) {
                  parser.addParserWarning("msg.jsdoc.meaning.extra",
                      stream.getLineno(), stream.getCharno());
                }
                continue retry;

              case NO_ALIAS:
                if (!jsdocBuilder.recordNoAlias()) {
                  parser.addParserWarning("msg.jsdoc.noalias",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case NO_COMPILE:
                if (!jsdocBuilder.recordNoCompile()) {
                  parser.addParserWarning("msg.jsdoc.nocompile",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case NO_TYPE_CHECK:
                if (!jsdocBuilder.recordNoTypeCheck()) {
                  parser.addParserWarning("msg.jsdoc.nocheck",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case NOT_IMPLEMENTED:
                token = eatTokensUntilEOL();
                continue retry;

              case INHERIT_DOC:
              case OVERRIDE:
                if (!jsdocBuilder.recordOverride()) {
                  parser.addTypeWarning("msg.jsdoc.override",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case THROWS:
                skipEOLs();
                token = next();
                lineno = stream.getLineno();
                charno = stream.getCharno();
                type = null;

                if (token == JsDocToken.LC) {
                  type = createJSTypeExpression(
                      parseAndRecordTypeNode(token));

                  if (type == null) {
                    // parsing error reported during recursive descent
                    // recovering parsing
                    token = eatTokensUntilEOL();
                    continue retry;
                  }
                }

                // *Update* the token to that after the type annotation.
                token = current();

                // Save the throw type.
                jsdocBuilder.recordThrowType(type);

                // Find the throw's description (if applicable).
                if (jsdocBuilder.shouldParseDocumentation()) {
                  ExtractionInfo descriptionInfo =
                      extractMultilineTextualBlock(token);

                  String description = descriptionInfo.string;

                  if (description.length() > 0) {
                    jsdocBuilder.recordThrowDescription(type, description);
                  }

                  token = descriptionInfo.token;
                } else {
                  token = eatTokensUntilEOL(token);
                }
                continue retry;

              case PARAM:
                skipEOLs();
                token = next();
                lineno = stream.getLineno();
                charno = stream.getCharno();
                type = null;

                if (token == JsDocToken.LC) {
                  type = createJSTypeExpression(
                      parseAndRecordParamTypeNode(token));

                  if (type == null) {
                    // parsing error reported during recursive descent
                    // recovering parsing
                    token = eatTokensUntilEOL();
                    continue retry;
                  }
                  skipEOLs();
                  token = next();
                  lineno = stream.getLineno();
                  charno = stream.getCharno();
                }

                String name = null;
                boolean isBracketedParam = JsDocToken.LB == token;
                if (isBracketedParam) {
                  token = next();
                }

                if (JsDocToken.STRING != token) {
                  parser.addTypeWarning("msg.missing.variable.name",
                      lineno, charno);
                } else {
                  name = stream.getString();

                  if (isBracketedParam) {
                    token = next();

                    // Throw out JsDocToolkit's "default" parameter
                    // annotation.  It makes no sense under our type
                    // system.
                    if (JsDocToken.EQUALS == token) {
                      token = next();
                      if (JsDocToken.STRING == token) {
                        token = next();
                      }
                    }

                    if (JsDocToken.RB != token) {
                      reportTypeSyntaxWarning("msg.jsdoc.missing.rb");
                    } else if (type != null) {
                      // Make the type expression optional, if it isn't
                      // already.
                      type = JSTypeExpression.makeOptionalArg(type);
                    }
                  }

                  // If the param name has a DOT in it, just throw it out
                  // quietly. We do not handle the JsDocToolkit method
                  // for handling properties of params.
                  if (name.indexOf('.') > -1) {
                    name = null;
                  } else if (!jsdocBuilder.recordParameter(name, type)) {
                    if (jsdocBuilder.hasParameter(name)) {
                      parser.addTypeWarning("msg.dup.variable.name", name,
                          lineno, charno);
                    } else {
                      parser.addTypeWarning("msg.jsdoc.incompat.type", name,
                          lineno, charno);
                    }
                  }
                }

                if (name == null) {
                  token = eatTokensUntilEOL(token);
                  continue retry;
                }

                jsdocBuilder.markName(name, sourceFile, lineno, charno);

                // Find the parameter's description (if applicable).
                if (jsdocBuilder.shouldParseDocumentation()) {
                  ExtractionInfo paramDescriptionInfo =
                      extractMultilineTextualBlock(token);

                  String paramDescription = paramDescriptionInfo.string;

                  if (paramDescription.length() > 0) {
                    jsdocBuilder.recordParameterDescription(name,
                        paramDescription);
                  }

                  token = paramDescriptionInfo.token;
                } else {
                  token = eatTokensUntilEOL(token);
                }
                continue retry;

              case PRESERVE_TRY:
                if (!jsdocBuilder.recordPreserveTry()) {
                  parser.addParserWarning("msg.jsdoc.preservertry",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case PRIVATE:
                if (!jsdocBuilder.recordVisibility(Visibility.PRIVATE)) {
                  parser.addParserWarning("msg.jsdoc.visibility.private",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case PROTECTED:
                if (!jsdocBuilder.recordVisibility(Visibility.PROTECTED)) {
                  parser.addParserWarning("msg.jsdoc.visibility.protected",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case PUBLIC:
                if (!jsdocBuilder.recordVisibility(Visibility.PUBLIC)) {
                  parser.addParserWarning("msg.jsdoc.visibility.public",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case NO_SHADOW:
                if (!jsdocBuilder.recordNoShadow()) {
                  parser.addParserWarning("msg.jsdoc.noshadow",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case NO_SIDE_EFFECTS:
                if (!jsdocBuilder.recordNoSideEffects()) {
                  parser.addParserWarning("msg.jsdoc.nosideeffects",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case MODIFIES:
                token = parseModifiesTag(next());
                continue retry;

              case IMPLICIT_CAST:
                if (!jsdocBuilder.recordImplicitCast()) {
                  parser.addTypeWarning("msg.jsdoc.implicitcast",
                      stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case SEE:
                if (jsdocBuilder.shouldParseDocumentation()) {
                  ExtractionInfo referenceInfo = extractSingleLineBlock();
                  String reference = referenceInfo.string;

                  if (reference.length() == 0) {
                    parser.addParserWarning("msg.jsdoc.seemissing",
                        stream.getLineno(), stream.getCharno());
                  } else {
                    jsdocBuilder.addReference(reference);
                  }

                  token = referenceInfo.token;
                } else {
                  token = eatTokensUntilEOL(token);
                }
                continue retry;

              case SUPPRESS:
                token = parseSuppressTag(next());
                continue retry;

              case TEMPLATE:
                ExtractionInfo templateInfo = extractSingleLineBlock();
                String templateTypeName = templateInfo.string;

                if (templateTypeName.length() == 0) {
                  parser.addTypeWarning("msg.jsdoc.templatemissing",
                        stream.getLineno(), stream.getCharno());
                } else if (!jsdocBuilder.recordTemplateTypeName(
                    templateTypeName)) {
                  parser.addTypeWarning("msg.jsdoc.template.at.most.once",
                      stream.getLineno(), stream.getCharno());
                }

                token = templateInfo.token;
                continue retry;

              case IDGENERATOR:
                if (!jsdocBuilder.recordIdGenerator()) {
                  parser.addParserWarning("msg.jsdoc.idgen",
                    stream.getLineno(), stream.getCharno());
                }
                token = eatTokensUntilEOL();
                continue retry;

              case VERSION:
                ExtractionInfo versionInfo = extractSingleLineBlock();
                String version = versionInfo.string;

                if (version.length() == 0) {
                  parser.addParserWarning("msg.jsdoc.versionmissing",
                        stream.getLineno(), stream.getCharno());
                } else {
                  if (!jsdocBuilder.recordVersion(version)) {
                     parser.addParserWarning("msg.jsdoc.extraversion",
                        stream.getLineno(), stream.getCharno());
                  }
                }

                token = versionInfo.token;
                continue retry;

              case DEFINE:
              case RETURN:
              case THIS:
              case TYPE:
              case TYPEDEF:
                lineno = stream.getLineno();
                charno = stream.getCharno();

                Node typeNode = null;
                if (!lookAheadForTypeAnnotation() &&
                    annotation == Annotation.RETURN) {
                  // If RETURN doesn't have a type annotation, record
                  // it as the unknown type.
                  typeNode = newNode(Token.QMARK);
                } else {
                  skipEOLs();
                  token = next();
                  typeNode = parseAndRecordTypeNode(token);
                }

                if (annotation == Annotation.THIS) {
                  typeNode = wrapNode(Token.BANG, typeNode);
                  if (typeNode != null && token != JsDocToken.LC) {
                    typeNode.putBooleanProp(Node.BRACELESS_TYPE, true);
                  }
                }
                type = createJSTypeExpression(typeNode);

                if (type == null) {
                  // error reported during recursive descent
                  // recovering parsing
                } else {
                  switch (annotation) {
                    case DEFINE:
                      if (!jsdocBuilder.recordDefineType(type)) {
                        parser.addParserWarning("msg.jsdoc.define",
                            lineno, charno);
                      }
                      break;

                    case RETURN:
                      if (!jsdocBuilder.recordReturnType(type)) {
                        parser.addTypeWarning(
                            "msg.jsdoc.incompat.type", lineno, charno);
                        break;
                      }

                      // Find the return's description (if applicable).
                      if (jsdocBuilder.shouldParseDocumentation()) {
                        ExtractionInfo returnDescriptionInfo =
                            extractMultilineTextualBlock(token);

                        String returnDescription =
                            returnDescriptionInfo.string;

                        if (returnDescription.length() > 0) {
                          jsdocBuilder.recordReturnDescription(
                              returnDescription);
                        }

                        token = returnDescriptionInfo.token;
                      } else {
                        token = eatTokensUntilEOL(token);
                      }
                      continue retry;

                    case THIS:
                      if (!jsdocBuilder.recordThisType(type)) {
                        parser.addTypeWarning(
                            "msg.jsdoc.incompat.type", lineno, charno);
                      }
                      break;

                    case TYPE:
                      if (!jsdocBuilder.recordType(type)) {
                        parser.addTypeWarning(
                            "msg.jsdoc.incompat.type", lineno, charno);
                      }
                      break;

                    case TYPEDEF:
                      if (!jsdocBuilder.recordTypedef(type)) {
                        parser.addTypeWarning(
                            "msg.jsdoc.incompat.type", lineno, charno);
                      }
                      break;
                  }
                }

                token = eatTokensUntilEOL();
                continue retry;
            }
          }
        }
        break;

      case EOC:
        if (hasParsedFileOverviewDocInfo()) {
          fileOverviewJSDocInfo = retrieveAndResetParsedJSDocInfo();
        }
        checkExtendedTypes(extendedTypes);
        return true;

      case EOF:
        // discard any accumulated information
        jsdocBuilder.build(null);
        parser.addParserWarning("msg.unexpected.eof",
            stream.getLineno(), stream.getCharno());
        checkExtendedTypes(extendedTypes);
        return false;

      case EOL:
        if (state == State.SEARCHING_NEWLINE) {
          state = State.SEARCHING_ANNOTATION;
        }
        token = next();
        continue retry;

      default:
        if (token == JsDocToken.STAR && state == State.SEARCHING_ANNOTATION) {
          token = next();
          continue retry;
        } else {
          state = State.SEARCHING_NEWLINE;
          token = eatTokensUntilEOL();
          continue retry;
        }
    }

    // next token
    token = next();
  }
}

/**
 * Extracts the text found on the current line and all subsequent
 * until either an annotation, end of comment or end of file is reached.
 * Note that if this method detects an end of line as the first token, it
 * will quit immediately (indicating that there is no text where it was
 * expected).  Note that token = info.token; should be called after this
 * method is used to update the token properly in the parser.
 *
 * @param token The start token.
 * @param option How to handle whitespace.
 *
 * @return The extraction information.
 */
@SuppressWarnings("fallthrough")
private ExtractionInfo extractMultilineTextualBlock(JsDocToken token,
                                                    WhitespaceOption option) {

  if (token == JsDocToken.EOC || token == JsDocToken.EOL ||
      token == JsDocToken.EOF) {
    return new ExtractionInfo("", token);
  }

  stream.update();
  int startLineno = stream.getLineno();
  int startCharno = stream.getCharno() + 1;

  // Read the content from the first line.
  String line = stream.getRemainingJSDocLine();
  if (option != WhitespaceOption.PRESERVE) {
    line = line.trim();
  }

  StringBuilder builder = new StringBuilder();
  builder.append(line);

  state = State.SEARCHING_ANNOTATION;
  token = next();

  boolean ignoreStar = false;

  // Track the start of the line to count whitespace that
  // the tokenizer skipped. Because this case is rare, it's easier
  // to do this here than in the tokenizer.

  do {
    switch (token) {
      case STAR:
        if (ignoreStar) {
          // Mark the position after the star as the new start of the line.
        } else {
          // The star is part of the comment.
          if (builder.length() > 0) {
            builder.append(' ');
          }

          builder.append('*');
        }

        token = next();
        continue;

      case EOL:
        if (option != WhitespaceOption.SINGLE_LINE) {
          builder.append("\n");
        }

        ignoreStar = true;
        token = next();
        continue;

      default:
        ignoreStar = false;
        state = State.SEARCHING_ANNOTATION;

            // All tokens must be separated by a space.

        if (token == JsDocToken.EOC ||
            token == JsDocToken.EOF ||
            // When we're capturing a license block, annotations
            // in the block are ok.
            (token == JsDocToken.ANNOTATION &&
             option != WhitespaceOption.PRESERVE)) {
          String multilineText = builder.toString();

          if (option != WhitespaceOption.PRESERVE) {
            multilineText = multilineText.trim();
          }

          int endLineno = stream.getLineno();
          int endCharno = stream.getCharno();

          if (multilineText.length() > 0) {
            jsdocBuilder.markText(multilineText, startLineno, startCharno,
                endLineno, endCharno);
          }

          return new ExtractionInfo(multilineText, token);
        }

        if (builder.length() > 0) {
          builder.append(' ');
        }
        builder.append(toString(token));

        line = stream.getRemainingJSDocLine();

        if (option != WhitespaceOption.PRESERVE) {
          line = trimEnd(line);
        }

        builder.append(line);
        token = next();
    }
  } while (true);
}

